Reports locks that are mistakenly passed by values. Accidentally copying a value containing a lock may cause both copies to work incorrectly. Generally, such values should be referred to through a pointer. A lock here means a type implementing 'sync.Locker', such as 'sync.Mutex' or 'sync.WaitGroup'. Example: 'type SafeInt struct {
  m sync.Mutex
  i int
}

func (s SafeInt) Inc() { // mutex is copied
  s.m.Lock()
  s.i++
  s.m.Unlock()
}' After the Add pointer quick-fix is applied: 'type SafeInt struct {
  m sync.Mutex
  i int
}

func (s *SafeInt) Inc() {
  s.m.Lock()
  s.i++
  s.m.Unlock()
}'

Reports impossible interface-to-interface type assertions. Checks for type assertions 'v.(T)' and corresponding type-switch cases in which the static type 'V' of 'v' is the interface that cannot possibly implement the target interface 'T'. This occurs when 'V' and 'T' contain methods with the same name but different signatures. Example: 'var v interface {
  Read()
}
_ = v.(io.Reader)' The 'Read' method in 'v' has a different signature than the 'Read' method in 'io.Reader', so this assertion cannot succeed. This inspection only reports if the language version is 1.15 or higher.

Reports unused type parameters. 'func main() {
