Reports 'defer' and 'go' statements that call 'panic()' or 'recover()' directly. Such statements are rarely useful and might indicate a misuse of the 'panic()' and 'recover()' mechanism. In particular: 'go panic()': a newly-started goroutine will panic immediately. 'defer panic()': a function with this statement will always panic on exit. 'go recover()': has no effect as newly-started goroutine cannot panic. 'defer recover()': function with this statement will silently stop panicking. This could be a valid usage, but an idiomatic way is to inspect the value returned by 'recover()': 'defer func() {
  if r := recover(); r != nil {
    fmt.Println("Recovered from: ", r)
  }
}()' For more information about go statements and panics handling, see Handling panics and Go statements in the Go Language Specification.

Reports calls of the 'errors.As' function when the second argument is not a pointer to an interface or to a type that implements an error. Such calls panic at runtime. For more information about the 'As' function, see func As at golang.org. Example: '_, err := os.Open("non-existing")
var pathError *fs.PathError
if errors.As(err, pathError) { // a pointer to *fs.PathError is required
}' After the Prepend '&' quick-fix is applied: '_, err := os.Open("non-existing")
var pathError *fs.PathError
if errors.As(err, &pathError) {
}' This inspection only reports if the language version is 1.13 or higher.

Reports possibly incorrect conversions of 'uintptr' to 'unsafe.Pointer'. A conversion from 'uintptr' to 'unsafe.Pointer' is invalid if it implies that there is a 'uintptr'-typed word in memory that holds a pointer value, because that word will be invisible to stack copying and to the garbage collector. Example of invalid usage: 'nums := []int8{42, 24}
ptr := unsafe.Pointer(&nums[0])
addr := uintptr(ptr) // address is stored to a local variable
ptr = unsafe.Pointer(addr + uintptr(1))' Example of valid usage: 'nums := []int8{42, 24}
ptr := unsafe.Pointer(&nums[0])
ptr = unsafe.Pointer(uintptr(ptr) + uintptr(1))'

Reports calls to functions and methods that do not handle the call result of the 'error' type. An API of such functions imply that their execution might finish unsuccessfully and they would return an error. Calls that do not handle the error result could be an indication of the API misuse. Example: 'os.Remove("non-existing") // error is ignored' After the Handle error quick-fix is applied: 'err := os.Remove("non-existing") // error is handled
if err != nil {
  return err
}'

