}' Code in the example will not compile. Therefore, it is highlighted as an error. You can apply two quick-fixes for such cases: Delete variable and Rename _. The first quick-fix deletes the variable, the second one will convert the variable to a blank identifier. After the Rename _ quick-fix is applied: 'func main() {
 _ := 422
}'

Reports assignment statements of the form 'x = atomic.AddUint64(&x, 1)'. Such operations are not atomic, and is a common misuse of the 'sync/atomic' API. To make them atomic, one need to remove the assignment to use a direct call: 'atomic.AddUint64(&x, 1)'. In that case, the value of 'x' will be updated atomically by address. Example: 'import (
 "sync/atomic"
)

type Counter uint64

func AtomicTests() {
 x := uint64(1)
 x = atomic.AddUint64(&x, 1)         // ERROR "direct assignment to atomic value"
 _, x = 10, atomic.AddUint64(&x, 1)  // ERROR "direct assignment to atomic value"
 x, _ = atomic.AddUint64(&x, 1), 10  // ERROR "direct assignment to atomic value"
}'

Reports assignments to method receivers. When you assign a value to the method receiver, the value will not be reflected outside of the method itself. Values will be reflected in subsequent calls from the same method. Example: 'package main

import "fmt"

type demo struct {
 Val int
}

func (d *demo) change() {
 d = nil // Assignment to the method receiver propagates only to callees but not to callers
 d.myVal()
}

func (d *demo) myVal() {
 fmt.Printf("my val: %#v\n", d)
}

func (d demo) change2() {
 d = demo{} // Assignment to the method receiver doesn't propagate to other calls
 d.myVal()
}

func (d *demo) change3() {
 d.Val = 3
 d.myVal()
}

func main() {
 d := &demo{}
 d.myVal()
 d.change()
 d.myVal()
 d.Val = 2
 d.change2()
 d.myVal()
 d.change3()
 d.myVal()
}'

fullDescription.markdown:
Reports assignments to method receivers.

When you assign a value to the method receiver, the value will not be reflected outside of the method itself.
Values will be reflected in subsequent calls from the same method.

Example:

    package main

    import "fmt"

    type demo struct {
     Val int
    }

    func (d *demo) change() {
     d = nil // Assignment to the method receiver propagates only to callees but not to callers
     d.myVal()
    }

    func (d *demo) myVal() {
     fmt.Printf("my val: %#v\n", d)
    }

    func (d demo) change2() {
     d = demo{} // Assignment to the method receiver doesn't propagate to other calls
     d.myVal()
    }

    func (d *demo) change3() {
     d.Val = 3
     d.myVal()
    }

    func main() {
     d := &demo{}
     d.myVal()
     d.change()
     d.myVal()
     d.Val = 2
     d.change2()
     d.myVal()
     d.change3()
     d.myVal()
    }

