Reports usages of unknown variables in Go Templates.

Parsing of such templates will cause panic because variables must be declared before usage.

Example:

    {{$v}} is zero. {{/* bad, $v is unknown */}}
    {{$v := 0}}{{$v}} is zero. {{/* good */}}

Reports duplicate Go Template variables that are declared in the same scope.

Duplicating a variable reassigns the existing variable with the same name. This operation might lead to different
unpredicatable issues.

Example:

    {{$v := 0}}{{$v := 1}}{{$v}} is 0. {{/* evaluates to '1 is 0' */}}
    {{$v := 0}}{{$w := 1}}{{$v}} is 0. {{/* works as expected */}}

